const cl = console.log;

const openModel = document.getElementById("openModel");
const backDrop = document.getElementById("backDrop");
const OurModel = document.getElementById("OurModel");
const Movieform = document.getElementById("Movieform");
const Movietitle = document.getElementById("Movietitle");
const MovieUrl = document.getElementById("MovieUrl");
const MovieRating = document.getElementById("MovieRating");
const MovieCardContainer = document.getElementById("MovieCardContainer");
const closeModel = [...document.querySelectorAll(".closeModel")]


let movieArr =[
    {
        title : "kgf",
        MovieUrl : `data:image/jpeg;base64,`,
        rating : 5,
    },
    {
        title : "chennai express",
        MovieUrl : `data:image/jpeg;base64,`,
        rating : 5,
    }
];

const templating = (arr) =>{
let result ="";
arr.forEach(ele =>{
  result += ` <div class="col-md-4 mb-6">
  <div class="card">
    <div class="card-header  d-flex justify-content-between align-items-center">
    <h2>${ele.title} </h2>
    <small> Rating : ${ele.rating}</small> 
    </div>
    <div class="card-body">
    
    <img src="${ele.MovieUrl}" alt="" class="MovieImg">
    </div>
    <div class="card-footer d-flex justify-content-between">
    <button class="btn btn-primary">Edit</button>
    <button class="btn btn-danger">Delete</button>
    </div>
  </div>
</div>
`
})
MovieCardContainer.innerHTML = result;
}
templating(movieArr);

const openModelHandler = () =>{
    backDrop.classList.toggle("active");
    OurModel.classList.toggle("active")
}
const onMovieSubmit =(eve) => {
    eve.preventDefault()
    let Obj = {
        title: Movietitle.value,
        MovieUrl:MovieUrl.value,
        rating:MovieRating.value
    }
    movieArr.push(Obj);
    templating(movieArr)
    cl(movieArr);
    Movieform.reset();
    openModelHandler();
}

openModel.addEventListener("click",openModelHandler);

closeModel.forEach(ele => {
    ele.addEventListener("click",openModelHandler)
})

Movieform.addEventListener("submit",onMovieSubmit)